          <Route path="/register" element={<Register />} />
          {/* <Route path="/post/:postId" element={<Single />} /> */}
          {/* <Route path="/write" element={user ? <Write /> : <Register />} /> */}
          {/* <Route path="/settings" element={user ? <Settings /> : <Register />} /> */}
        </Routes>
      </Router>
    </div>
  )
}

export default App
